function App() {
  return (

    <Router>
      <div className='App'>

        <Switch>

          <Route>
            <h1>Aloraa ?</h1>
          </Route>

          <Route path="/">
            <h1>Hello</h1>
          </Route>


        </Switch>
      </div>

    </Router>



  );
}

export default App;
